#
# View "v_importacao"
#

CREATE
  ALGORITHM = UNDEFINED
  VIEW `v_importacao`
  AS
  SELECT
    `p`.`PROJETO` AS 'projeto',
    (SELECT ROUND(AVG(`f`.`PF_SYS`), 2) FROM `importar_dados_projeto` f WHERE ((`f`.`PROJETO` = `p`.`PROJETO`) AND (`f`.`PF_SYS` > 0.5))) AS 'fp',
    (SELECT ROUND(AVG(`f`.`W_SYS`), 2) FROM `importar_dados_projeto` f WHERE ((`f`.`PROJETO` = `p`.`PROJETO`) AND (`f`.`W_SYS` > 25))) AS 'ativo',
    (SELECT ROUND(AVG(`f`.`VA_SYS`), 2) FROM `importar_dados_projeto` f WHERE ((`f`.`PROJETO` = `p`.`PROJETO`) AND (`f`.`VA_SYS` > 25))) AS 'aparente',
    (SELECT ROUND(AVG(`f`.`VAR_SYS`), 2) FROM `importar_dados_projeto` f WHERE ((`f`.`PROJETO` = `p`.`PROJETO`) AND (`f`.`VAR_SYS` > 0))) AS 'reativo'
  FROM
    `importar_dados_projeto` p
  GROUP BY
    `p`.`PROJETO`;
